import './App.css';

function App() {
  return (
    <header className="header">
    <h1 className="">Progbr</h1>
      <ul className="menu">
        <li className="about">About</li>
        <li className="buy">Buy</li>
        <li className="contact">Contact</li>
      </ul>
    </header>
  );
}

export default App;
